import React,{Component} from 'react'
  
class LoginApp extends Component{
    render(){
        return(

            <div className="LoginApp">

<Flogin/>
            </div>
        )
    }
}






class Flogin extends Component{
    constructor(props){
        super(props)
        this.state={
            username:'djany',
            password:''
        }
this.handleUsernameChange = this.handleUsernameChange.bind(this)
this.handlePasswordChange = this.handlePasswordChange.bind(this)
    }
    
    handleUsernameChange(event){
        console.log(event.target.value);
        this.setState({username:event.target.value})

    }
    handlePasswordChange(event){
        console.log(event.target.value);
        this.setState({password:event.target.value})

    }
    
    
    render(){
        return(
            <div><div>
UserName:<input type="text" name="username" value={this.state.username} onChange={this.handleUsernameChange}/>
</div>
<div>
Password:<input type="password" name="password"value={this.state.password} onChange={this.handlePasswordChange}/></div>
<button>Login</button>
</div>

        )
    }
}
export default LoginApp
